!function() {
    function convertBase64ToBinary(base64) {
        var raw = window.atob(base64);
        var rawLength = raw.length;
        var array = new Uint8Array(new ArrayBuffer(rawLength));

        for (var i = 0; i < rawLength; i++) {
            array[i] = raw.charCodeAt(i);
        }
        return array;
    }

    function DeviceStorage(mediaType) {
        var blobs = {
            'file0.png': '',
            'file1.png': ''
        };

        // eventemitter shim
        this.listeners = {};
        this.addEventListener = function(ev, fn) {
            this.listeners[ev] = this.listeners[ev] || [];
            this.listeners[ev].push(fn);
        };
        this.removeEventListener = function(ev, fn) {
            if (!this.listeners[ev]) return;
            this.listeners[ev].splice(this.listeners[ev].indexOf(fn), 1);
        };
        this.dispatchEvent = function(ev, data) {
            var self = this;
            if (!this.listeners[ev]) return;
            this.listeners[ev].forEach(function(fn) {
                fn.call(self, data);
            });
        };

        // interface DeviceStorage
        this.$addIx = 0;
        this.add = function(blob) {
            var name = 'new' + (++this.$addIx) + '.png';
            return this.addNamed(blob, name);
        };

        this.addNamed = function(blob, name) {
            blobs[name] = blob;
            console.log('addNamed!', Object.keys(blobs).length);

            var proxy = {};
            setTimeout(function() {
                proxy.onsuccess();
            });
            return proxy;
        };

        this.get = function(name) {
            var proxy = {};

            var blob = blobs[name];
            if (!blob) {
                setTimeout(function() {
                    proxy.onerror();
                });
                return proxy;
            }
            var decoded = new Blob([convertBase64ToBinary(blob)], {
              type: 'image/png'
            });
            decoded.name = name;
            decoded.lastModifiedDate = new Date();

            setTimeout(function() {
                proxy.result = decoded;
                proxy.onsuccess();
            });

            return proxy;
        };

        this.freeSpace = function() {
            var proxy = {};
            setTimeout(function() {
                proxy.result = 10000000;
                proxy.onsuccess({ target: { result: proxy.result } });
            });
            return proxy;
        };

        this.getEditable = function(name) {
            console.log('DeviceStorage.getEditable');
        };

        this.delete = function(path) {
            console.log('DeviceStorage.delete');
            var self = this;
            delete blobs[path];

            setTimeout(function() {
                self.dispatchEvent('change', {
                    reason: 'deleted',
                    path: path
                });
            });
            return {}; // return proxy object, nothing to see here, move along
        };

        this.enumerate = function() {
            console.log('DeviceStorage.enumerate', Object.keys(blobs).length);
            var cursor = new (function() {
                var self = this;

                this.ix = -1;
                this.results = {};

                this.__defineGetter__('result', function() {
                    console.log('DeviceStorage.enumerate.result',
                      typeof self.results[self.ix]);
                    return self.results[self.ix];
                });

                this.continue = function() {
                    var ix = ++this.ix;
                    var blob = blobs[Object.keys(blobs)[ix]];
                    console.log('DeviceStorage.continue', ix);
                    // if there are no results we'll have to invoke with NULL
                    if (!blob) {
                        this.results[ix] = null;
                        setTimeout(function() {
                            self.onsuccess();
                        });
                        return;
                    }

                    // decode the base64 blob to a normal Blob thingy
                    var decoded = new Blob([convertBase64ToBinary(blob)], {
                      type: 'image/png'
                    });
                    decoded.name = 'file' + ix + '.png';
                    decoded.lastModifiedDate = new Date();
                    this.results[ix] = decoded;

                    // if you need to simulate sd card speed, add timeout here
                    setTimeout(function() {
                        self.onsuccess();
                    });
                };
            })();

            // cursor should continue the first time automagically
            setTimeout(function() {
                cursor.continue();
            }, 1000); // 1000 ms. initial scanning time

            return cursor;
        };

        this.enumerateEditable = function() {
            console.error('NotImplemented: DeviceStorage.enumerateEditable');
        };

        this.available = function() {
            var proxy = {};
            setTimeout(function() {
                proxy.onsuccess({ target: { result: 'available' } });
            });
            return proxy;
        };
    }

    var deviceStorages = {};

    var getDeviceStorage = function(mediaType) {
        if (!deviceStorages[mediaType]) {
            deviceStorages[mediaType] = new DeviceStorage(mediaType);
        }

        return deviceStorages[mediaType];
    };

    FFOS_RUNTIME.makeNavigatorShim('getDeviceStorage', getDeviceStorage);
}();
